DROP TRIGGER IF EXISTS `customer_create_date`;
DELIMITER ;;
CREATE TRIGGER `customer_create_date` BEFORE INSERT ON `zj_customer` FOR EACH ROW SET NEW.create_date = NOW()
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `ins_film`;
DELIMITER ;;
CREATE TRIGGER `ins_film` AFTER INSERT ON `zj_film` FOR EACH ROW BEGIN
        VALUES (new.film_id, new.title, new.description);
  END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `upd_film`;
DELIMITER ;;
CREATE TRIGGER `upd_film` AFTER UPDATE ON `zj_film` FOR EACH ROW BEGIN
    IF (old.title != new.title) OR (old.description != new.description) OR (old.film_id != new.film_id)
    THEN
        UPDATE film_text
            SET title=new.title,
                description=new.description,
                film_id=new.film_id
        WHERE film_id=old.film_id;
    END IF;
  END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `del_film`;
DELIMITER ;;
CREATE TRIGGER `del_film` AFTER DELETE ON `zj_film` FOR EACH ROW BEGIN
    DELETE FROM film_text WHERE film_id = old.film_id;
  END
;;
DELIMITER ;
